import React, { Component } from 'react';
import { Route, Link } from 'react-router-dom';
import './App.css';
import Landing from './components/Landing';
import Library from './components/Library';
import Album from './components/Album';

class App extends Component {
  render() {
    return (
      <div className="App">
       <header>
	      <nav>
           <Link activeclassname="linkActive" id="home" to='/'>HOME</Link>
	         <Link activeclassname="linkActive" id="music" to='/Library'>MUSIC</Link>
        </nav>
        <h1 id="mainBranding">CHAU.Z  RADIO</h1>
       </header>
       <main>
          <Route exact path="/" component={Landing} />
	        <Route path="/library" component={Library}/>
	        <Route path="/album/:slug" component={Album}/>
       </main>
       <footer>
         <h1>CHAU.Z</h1>
         <h3>Copyright &copy 2019 J.Daguna / Powered by BlocJams</h3>
         <i className="ion-social-github-outline custom-icon"/>
       </footer>
      </div>
    );
  }
}
//testing~~~~!
export default App;
